import { Component } from '@angular/core';
import { Produto } from 'src/app/models/produto';
import { ProdutoService } from 'src/app/services/produto.service';

@Component({
  selector: 'app-update-produto',
  templateUrl: './update-produto.component.html',
  styleUrls: ['./update-produto.component.css']
})
export class UpdateProdutoComponent {
  constructor(private produtoService: ProdutoService){}
  atualizarProduto() {
    const c = new Produto()
    c.Name = 'Mouse'
    c. Description = 'Mouse reddragon'
    c.Price= 120
    c.Quantity = 200
    let observable = this.produtoService.put('1', c)
    observable.subscribe(s => {
      console.log(s);
    })
  }

}
